            while (i + count < str.Length)
            {
                var tmp = str.Substring(i, count);
                for (int j = i + count; j < str.Length; j++)
                {
                    if (tmp.Contains(str[j]))
                    {
                        i++;

                        if (count > 1) count--;

                        break;
                    }

                    tmp += str[j];

                    count++;

                    if (count > maxLength)
                    {
                        tmpIndex = i;
                        maxLength = count;
