        /// <summary>
        /// 数组中位数
        /// </summary>
        /// <returns></returns>
        public static float Median()
        {
            int[] nums1 = { 1 },
                nums2 = { 2, 3, 4, 5, 6, 7 };
            int m = nums1.Length, m2 = Math.Max(m - 1, 0);
            int n = nums2.Length, n2 = Math.Max(n - 1, 0);
            int len = m + n;
            bool flag = len % 2 == 0;
            int len2 = flag ? len / 2 : len / 2 + 1;
            int k = len2, left, right, aStart = 0, bStart = 0;

            void SetRight(int i1, int l1, int i2, int[] ns1, int[] ns2)
            {
                if (flag)
                {
                    if (i1 >= l1 || (ns2.Length > 0 && i2 < ns2.Length && ns2[i2] < ns1[i1 + 1]))
                    {
                        right = ns2[i2];
                    }
                    else
                    {
                        right = ns1[i1 + 1];
                    }
                }
                else
                {
                    right = left;
                }
            }

            while (true)
            {
                if (aStart >= m)
                {
                    int index = bStart + k - 1;
                    left = nums2[index];
                    SetRight(index, n2, aStart, nums2, nums1);
                    break;
                }

                if (bStart >= n)
                {
                    var index = aStart + k - 1;
                    left = nums1[index];
                    SetRight(index, m2, bStart, nums1, nums2);
                    break;
                }

                if (k == 1)
                {
                    if (nums1[aStart] < nums2[bStart])
                    {
                        left = nums1[aStart];
                        SetRight(aStart, m2, bStart, nums1, nums2);
                    }
                    else
                    {
                        left = nums2[bStart];
                        SetRight(bStart, n2, aStart, nums2, nums1);
                    }

                    break;
                }

                int half = k / 2, index1 = Math.Min(aStart + half, m) - 1, index2 = Math.Min(bStart + half, n) - 1;
                if (nums1[index1] < nums2[index2])
                {
                    k -= index1 - aStart + 1;
                    aStart = index1 + 1;
                }
                else
                {
                    k -= index2 - bStart + 1;
                    bStart = index2 + 1;
                }
            }

            return (left + right) / 2.0f;
        }

        /// <summary>
        /// 最大回文字符串
        /// </summary>
        /// <returns></returns>
        public static string MaxPalindromeCharacter()
        {
            string s = "bbabbabbabb";

            if (s.Length <= 1) return s;

            int sl = s.Length + s.Length - 1, len = 1, index = 0;
            for (int i = 0; i < sl; i++)
            {
                for (int j = 1; i + j < sl; j++)
                {
                    int li = i - j, ri = i + j,
                        tli = li / 2, tri = ri / 2,
                        l = tri - tli + 1;

                    if (li < 0) break;

                    if (li % 2 != 0 || ri % 2 != 0) continue;

                    if (s[tli] != s[tri]) break;

                    if (l > len)
                    {
                        //Console.WriteLine(s.Substring(tli, l));

                        index = tli;
                        len = l;
                    }
                }
            }

            return s.Substring(index, len);
        }

        /// <summary>
        /// z字变换
        /// </summary>
        /// <returns></returns>
        public static string ConvertZ()
        {
            string s = "PAYPALISHIRING";
            int numRows = 5;
            if (numRows == 1) return s;

            int step = 2 * (numRows - 1);
            StringBuilder sb = new();

            for (int i = 0; i < numRows; i++)
            {
                for (int j = i; j < s.Length; j += step)
                {
                    sb.Append(s[j]);
                    //Console.WriteLine(j);

                    int k;
                    if (i != 0 && i != numRows - 1 && (k = j + (step - 2 * i)) < s.Length)
                    {
                        sb.Append(s[k]);
                        //Console.WriteLine(k);
                    }
                }
            }

            return sb.ToString();
        }

        /// <summary>
        /// 三数之和
        /// </summary>
        /// <returns></returns>
        public static IList<IList<int>> ThreeNumbersSum()
        {
            int[] nums = { 12, 0, 3, -14, 5, -11, 11, -5, -2, -1, 6, -7, -10, 1, 4, 1, 1, 9, -3, 6, -15, 0, 6, 1, 6, -12, 3, 7, 11, -6, -8, 0, 9, 3, -7, -1, 7, -10, 1, 13, -4, -7, -9, -7, 9, 3, 1, -13, -3, 13, 8, -11, -9, -8, -3, 4, -13, 7, -11, 5, -14, -4, -9, 10, 6, -9, -6, -9, -12, 11, -11, -9, 11, -5, 0, -3, 13, -14, -1, -13, 7, -7, 14, 5, 0, -4, -6, -6, -11, -2, 14, -10, 2, 12, 8, -7, -11, -13, -9, 14, 5, -5, -9, 1, -2, 6, 5, -12, -1, -10, -9, -9, -10, 12, 11 };

            var result = new List<IList<int>>();

            if (nums.Length < 3) return result;
            if (nums.Length == 3)
            {
                if (nums[0] + nums[1] + nums[2] == 0)
                {
                    result.Add(nums);
                }

                return result;
            }

            var nums1 = nums.OrderBy(x => x).ToArray();
            for (int i = 0; i < nums1.Length; i++)
            {
                if (nums1[i] > 0) return result;

                if (i > 0 && nums1[i] == nums1[i - 1]) continue;

                int left = i + 1, right = nums1.Length - 1;

                while (left < right)
                {
                    if (nums1[i] + nums1[left] + nums1[right] == 0)
                    {
                        result.Add(new int[] { nums1[i], nums1[left], nums1[right] });

                        while (left < right && nums1[left] == nums1[left + 1])
                            left++;

                        while (left < right && nums1[right] == nums1[right - 1])
                            right--;

                        left++;
                        right--;
                    }
                    else if (nums1[i] + nums1[left] + nums1[right] > 0)
                    {
                        right--;
                    }
                    else
                    {
                        left++;
                    }
                }
            }

            return result;
        }

        /// <summary>
        /// 数字反转
        /// </summary>
        /// <returns></returns>
        public static int Reverse()
        {
            int x = -2147483648;

            var result = "";
            bool flag = x < 0;
            var str = x.ToString().TrimStart('-');
            var max = flag ? "2147483648" : "2147483647";
            int count = 0, eqCount = 0;

            for (int i = str.Length - 1; i >= 0; i--)
            {
                if (str.Length == 10)
                {
                    if (count == eqCount && str[i] > max[count])
                    {
                        return 0;
                    }
                    else if (str[i] == max[count])
                    {
                        eqCount++;
                    }
                }

                result += str[i];

                count++;
            }

            var res = int.Parse(result);

            return flag ? -res : res;
        }

        public static int MyAtoi()
        {
            string s = "1";

            s = s.TrimStart(' ');
            int begin = -1, len = 0, si = -2;
            bool flag2 = false;
            for (int i = 0; i < s.Length; i++)
            {
                bool flag = s[i] > 47 && s[i] < 58, bg = false;
                if (begin == -1 && (flag || s[i] == '-' || s[i] == '+'))
                {
                    begin = i;
                    bg = true;
                }

                if ((!bg && !flag) || i == s.Length - 1)
                {
                    if (begin > -1)
                    {
                        len = i - begin + ((i == s.Length - 1 && flag) ? 1 : 0);
                    }

                    break;
                }

                if (s[i] == '-' || s[i] == '+')
                {
                    if (i != 0) return 0;

                    if (si == i - 1) return 0;

                    si = i;

                    flag2 = s[i] == '-';
                }
            }

            if (begin == -1 || len == 0) return 0;
            if (si > -1 && len == 1) return 0;

            //Console.WriteLine(s.Substring(begin, len));

            return int.TryParse(s.AsSpan(begin, len), out var t) ? t : (flag2 ? int.MinValue : int.MaxValue);
        }

        /// <summary>
        /// 回文数
        /// </summary>
        /// <returns></returns>
        public static bool IsPalindrome()
        {
            int x = 12321;
            //1#2#3#2

            if (x < 0) return false;

            string s = x.ToString();
            int len = s.Length + s.Length - 1, half = len / 2;
            for (int i = 1; half - i >= 0; i++)
            {
                int l = (half - i) / 2, r = (half + i) / 2;
                if ((half + i) % 2 != 0) continue;
                if (r >= s.Length) return false;
                if (s[l] != s[r]) return false;
            }

            return true;
        }

        /// <summary>
        /// 正则匹配
        /// </summary>
        /// <returns></returns>
        public static bool IsMatch()
        {
            string s = "abbbabaaaaaaacaa", p = "a*.*b.a.*c*b*a*c*";
            bool flag = false;
            int index = s.Length - 1;
            for (int i = p.Length - 1; i >= 0; i--)
            {
                if (p[i] == '*')
                {
                    flag = true;
                    continue;
                }

                if (!flag && index < 0)
                {
                    return false;
                }

                if (flag)
                {
                    int count = 0, ti = i - 1;
                    while (ti >= 0)
                    {
                        if (p[ti] == '*') ti--;
                        else if (p[i] != '.' && p[ti] != p[i]) break;
                        else
                        {
                            count++;
                        }

                        ti--;
                    }

                    ti = index;
                    while (ti >= 0 && (p[i] == '.' || s[ti] == p[i]))
                    {
                        count--;
                        ti--;
                    }

                    if (count < 0) index += count;

                    flag = false;
                }
                else
                {
                    if (p[i] != '.' && s[index] != p[i])
                        return false;
                    else index--;
                }
            }

            return index < 0;
        }

