        /// <returns></returns>
        public static int MaxArea()
        {
            #region
            int[] height = { 1, 2, 3 };
            #endregion

            int area = 0;

            #region 双循环
            //for (int i = 0; i < height.Length; i++)
            //{
            //    for (int j = i + 1; j < height.Length; j++)
            //    {
