            //        if(t > area)
            //        {
            //            area = t;
            //        }
            //    }
            //}
            #endregion

            #region 双指针
            int left = 0, right = height.Length - 1;
            while (left < right)
            {
                int t = Math.Min(height[left], height[right]) * (right - left);

                if (height[left] > height[right]) right--;
                else left++;

                if (t > area) area = t;
            }
            #endregion

            return area;
        }

