        public static int RomanToInt()
        {
            string s = "MCMXCIV";

            //I             1
            //V             5
            //X             10
            //L             50
            //C             100
            //D             500
            //M             1000

            int num = 0;

            #region 
            var kv = new Dictionary<string, int> {
                { "M", 1000 },
                { "CM", 900 },
                { "D", 500 },
                { "CD", 400 },
                { "C", 100 },
                { "XC", 90 },
                { "L", 50 },
                { "XL", 40 },
                { "X", 10 },
                { "IX", 9 },
                { "V", 5 },
                { "IV", 4 },
                { "I", 1 }
            };

            for (int i = 0; i < s.Length; i++)
            {
                var k = i + 1 < s.Length ? s.Substring(i, 2) : string.Empty;
                if (kv.ContainsKey(k))
                {
                    num += kv[k];
                    i++;
                }
                else
                {
                    num += kv[s.Substring(i, 1)];
                }
            }
            #endregion

            return num;
        }

        /// <summary>
        /// 最长相同子串
        /// </summary>
        /// <returns></returns>
        public static string LongestCommonPrefix()
        {
            string[] strs = new string[] { "a", "b" };

            if (strs.Length == 0) return "";
            if (strs.Length == 1) return strs[0];

            strs = strs.OrderBy(x => x.Length).ToArray();
            int len = strs[0].Length;

            if (len == 0) return "";

            var k = 0;
            while (k < len)
            {
                for (int i = 1; i < strs.Length; i++)
                {
                    if (strs[i][k] != strs[0][k])
                    {
                        return strs[0][..k];
                    }
                }

                k++;
            }

            return strs[0][..len];
        }

        /// <summary>
        /// 三数相加
        /// </summary>
        /// <returns></returns>
        public static int ThreeSumClosest()
        {
            int[] nums = new int[] { -1000, -5, -5, -5, -5, -5, -5, -1, -1, -1 }; int target = -14;

            var result = -1;
            if (nums.Length == 3)
            {
                return nums[0] + nums[1] + nums[2];
            }

            var nums1 = nums.OrderBy(x => x).ToArray();
            for (int i = 0; i < nums1.Length; i++)
            {
                int left = i + 1, right = nums1.Length - 1;

                while (left < right)
                {
                    int t = nums1[i] + nums1[left] + nums1[right];
                    if (t == target)
                    {
                        return target;
                    }
                    else if (t > target)
                    {
                        right--;
                    }
                    else
                    {
                        left++;
                    }

                    if (result == -1 || Math.Abs(t - target) < Math.Abs(result - target))
                    {
                        result = t;
                    }
                }
            }

            return result;
        }

        /// <summary>
        /// 电话号码数字组合
        /// </summary>
        /// <returns></returns>
        public static IList<string> LetterCombinations()
        {
            string digits = "";

            var result = new List<string>();
            if (digits.Length == 0) return result;

            var ks = new Dictionary<char, string>
            {
                { '2', "abc" },
                { '3', "def" },
                { '4', "ghi" },
                { '5', "jkl" },
                { '6', "mno" },
                { '7', "pqrs" },
                { '8', "tuv" },
                { '9', "wxyz" },
            };

            void rec(int index, string path)
            {
                for (int i = 0; i < ks[digits[index]].Length; i++)
                {
                    var t = path + ks[digits[index]][i];

                    if (index < digits.Length - 1)
                    {
                        rec(index + 1, t);
                    }
                    else
                    {
                        result.Add(t);
                    }
                }
            }

            rec(0, "");

            return result;
        }

